    <RadioGroup>
      <Radio onChange={radioChangeHandler} value="1" label="radio1" />
      <Radio onChange={radioChangeHandler} value="2" label="radio2" />
      <Radio onChange={radioChangeHandler} value="3" label="radio3" />
    </RadioGroup>
  );
};

RadioGroupColumn.args = {
